d C.P.R. 5. 14, N. Gonis, Archiv 51 (2005), S. 91.\";}','bernini'),(5587,'update','2014-01-13 12:36:38','1804','Papyrillio\\BeehiveBundle\\Entity\\Correction',3,'a:1:{s:11:\"description\";s:126:\"Philoxenos, Vater des Gerontios, ist viell. derselbe von Stud.Pal 3.2 164, Z. 1, S. Kovarik, Archiv 53 (2007), S. 154 und 170.\";}','bernini'),(5588,'update','2014-01-13 12:37:17','1996','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:268:\"Der vir clarissimus Flavius Ausonius ist wahrscheinlich derselbe von S.B. 22. 15586, P. Vindob. Sijp. 9, Stud. Pal. 20. 111, P. Heid. 7. 408, und viell. der corrector Augustamnicae der liegt in den Briefen von Isidor von Pelusium, N. Gonis, Archiv 51 (2005), S. 88-90.\";}','bernini'),(5589,'update','2014-01-13 12:38:15','1802','Papyrillio\\BeehiveBundle\\Entity\\Correction',3,'a:1:{s:11:\"description\";s:130:\"Iustos ist derselbe von Stud.Pal. 20. 125 Verso, P.Ross.Georg. 3. 55,6-8, Stud.Pal. 3.2 164, 2, S.B. 1. 4488,7-9, B.G.U. 2. 694,1.\";}','bernini'),(5590,'update','2014-01-13 12:38:58','1814','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:180:\"Νειλάμμων ὁ καὶ βόηθος ist viell. derselbe von S.B. 1. 4483, Z. 4-5, P. Ross.-Georg. 3. 55, Z. 8, S.B. 1. 4488, 9, S. Kovarik, Archiv 53 (2007), S. 152 Anm. 2.\";}','bernini'),(5591,'update','2014-01-13 12:39:47','1980','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:173:\"Der σχολαστικός Flavius Andronicus von Stud.Pal. 20. 122 könnte dieselbe Person von Photius, Bibl. cod. 279.536a sein, N. Gonis, Archiv 51 (2005), S. 87, Anm. 2.\";}','bernini'),(5592,'update','2014-01-13 12:40:24','1989','Papyrillio\\BeehiveBundle\\Entity\\Correction',4,'a:1:{s:11:\"description\";s:189:\"Der curialis Olympius ist derselbe von M.P.E.R. 15. 63, Z. 33 (er könnte derselbe Olympius von C.P.R. 10. 114 , C.P.R. 19. 51 und P. L.Bat. 11. 22 sein), N. Gonis, Archiv 51 (2005), S. 92.\";}','bernini'),(5593,'create','2014-01-1