03 14:40:20','1982','Papyrillio\\BeehiveBundle\\Entity\\Task',1,'a:2:{s:11:\"description\";s:36:\"Enter correction to DDbDP via editor\";s:7:\"cleared\";N;}','bernini'),(5818,'create','2014-02-03 14:40:20','2093','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";N;s:11:\"description\";s:76:\"Der Text liegt an dem Verso, D. Hagedorn Z.P.E. 159 (2007), S. 264, Anm. 19.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(5819,'create','2014-02-03 14:43:07','1983','Papyrillio\\BeehiveBundle\\Entity\\Task',1,'a:2:{s:11:\"description\";s:36:\"Enter correction to DDbDP via editor\";s:7:\"cleared\";N;}','bernini'),(5820,'create','2014-02-03 14:43:07','2094','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";s:1:\"3\";s:11:\"description\";s:227:\"[ἐ]κ τοῦ καταλογ(είου) δη̣(μοσιώσεως) χ̣ρ̣η̣ματισμό̣ν̣ → [ἐ]κ τοῦ καταλ̣(ογείου) χρ̣η̣ματισμό̣ν̣, D. Hagedorn Z.P.E. 159 (2007), S. 264, Anm. 19.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(5821,'create','2014-02-03 15:08:17','2095','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";N;s:11:\"description\";s:65:\"Zu datieren: 88-96 n.Chr., D. Hagedorn Z.P.E. 159 (2007), S. 264.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(5822,'create','2014-02-03 15:18:14','1984','Papyrillio\\BeehiveBundle\\Entity\\Task',1,'a:2:{s:11:\"description\";s:36:\"Enter correction to DDbDP via editor\";s:7:\"cleared\";N;}','bernini'),(5823,'create','2014-02-03 15:18:14','2096','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";s:1:\"3\";s:11:\"description\";s:126:\"η̣ → die Lesung der Jahreszahl ist unmöglich, D. Hagedorn Z.P.E. 159 (2007), S. 264 (am Original geprüft von R. Scholl).\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(5824,'update','2014-02-03 15:30:46','2096','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:233:\"η̣ → die Lesung der Jahreszahl ist falsch; der Papyrus sollte an der Ende einer Regierungsjahres zwischen 88 und 96 n.Chr. datiert werden, D. Hagedorn Z.P.E. 159 (2007), S. 264 (am Original geprüft von R. Scholl und nach Photo).\";}','bernini'),(5825,'update','2014-02-04 10:07:33','2033','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:230:\"Dir Korrektur Ἰουστ(ινιανοῦ) statt Ῥουστ(ικίου) (F. Mitthof, Archiv 51 (2005), S. 289) ist richtig, daher der Text war am 5.1, 4.2, 6.3 oder 5.4.522 n.Chr. geschrieben, N. Gonis, Z.P.E. 159 (2007), S. 267.\";}','bernini'),(5826,'create','2014-02-04 10:42:52','2097','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";s:1:\"4\";s:11:\"description\";s:128:\"Eine Abgekürzte Form von λαμπροτάτῳ könnte in der Lücke gewesen sein, N. Gonis, Z.P.E. 159 (2007), S. 270, Anm. 10\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(5827,'create','2014-02-04 10:59:20','1985','Papyrillio\\BeehiveBundle\\Entity\\Task',1,'a:2:{s:11:\"description\";s:36:\"Enter correction to DDbDP via editor\";s:7:\"cleared\";N;}','bernini'),(5828,'create','2014-02-04 10:59:20','2098','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";s:2:\"11\";s:11:\"description\";s:157:\"±? τοῖς σο]φωτά(τοις) → τοῖς λαμπρότα(τοις) καὶ σο]φωτά(τοις), N. Gonis, Z.P.E. 159 (2007), S. 270, Anm. 10.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(5829,'update','2014-02-04 10:59:58','2098','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:157:\"±? τοῖς σο]φωτά(τοις) → τοῖς λαμπροτά(τοις) καὶ σο]φωτά(τοις), N. Gonis, Z.P.E. 159 (2007), S. 270, Anm. 10.\";}','bernini'),(5830,'create','2014-02-05 10:21:01','2099','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";N;s:11:\"description\";s:295:\"Auf der Rückseite gibt es lwsymkws (sc. Lysimachos) geschrieben, der ist der Apa Lysimachos von einiger Urkunden von P.Kell. 5., besonders Nr. 30, (aber vgl. die Anm. von M. Franzmann). Er, der manichäischen ist, ist der Autor des Briefes, I. Gardner, Z.P.E. 159 (2007), S. 224-227 mit Anm. 3.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(5831,'create','2014-02-05 10:41:40','2100','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";s:2:\"19\";s:11:\"description\";s:106:\"Ision ist dieselbe Person von ein Koptischer Briefes von Philammon, I. Gardner, Z.P.E. 159 (2007), S. 224.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(5832,'update','2014-02-05 10:42:19','2100','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:107:\"Ision ist dieselbe Person von einem Koptische Briefes von Philammon, I. Gardner, Z.P.E. 159 (2007), S. 224.\";}','bernini'),(5833,'update','2014-02-05 10:43:22','2100','Papyrillio\\BeehiveBundle\\Entity\\Correction',3,'a:1:{s:11:\"description\";s:105:\"Ision ist dieselbe Person von einem Koptische Brief von Philammon, I. Gardner, Z.P.E. 159 (2007), S. 224.\";}','bernini'),(5834,'create','2014-02-05 10:45:28','2101','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";N;s:11:\"description\";s:108:\"Die zwei Briefe von Lysimachos gehören an der Gruppe des Philammons, I. Gardner, Z.P.E. 159 (2007), S. 224.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(5835,'update','2014-02-05 10:45:56','2101','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:108:\"Die zwei Briefe des Lysimachos gehören an der Gruppe des Philammons, I. Gardner, Z.P.E. 159 (2007), S. 224.\";}','bernini'),(5836,'create','2014-02-05 11:03:43','1986','Papyrillio\\BeehiveBundle\\Entity\\Task',1,'a:2:{s:11:\"description\";s:36:\"Enter correction to DDbDP via editor\";s:7:\"cleared\";N;}','bernini'),(5837,'create','2014-02-05 11:03:43','2102','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";N;s:11:\"description\";s:345:\"Die Adresse geschrieben auf Syrisch bezeichnet wahr. den Namen des Empfängers, denn man kann denken dass auch der Name des Empfängers war auf Griechisch geschrieben, „An Theognostos“ (dies bedeutet, das verlorene Teil war mehr erheblich, und die ursprünglichen Dimensionen etwa 28 x 7.6 cm), I. Gardner, ZPE 159 (2007), S. 225 mit Anm. 8.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(5838,'update','2014-02-05 11:39:29','2087','Papyrillio\\BeehiveBundle\\Entity\\Correction',3,'a:1:{s:11:\"description\";s:113:\"ο̣[ → ὁ̣ [πατήρ (oder π(ατ)ήρ) σου, I. Gardner, Z.P.E. 159 (2007), S. 225 mit Anm. 10 und 11.\";}','bernini'),(5839,'create','2014-02-05 11:57:20','2103','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";N;s:11:\"description\";s:156:\"Philammon bezieht sich nie auf Makarios oder ihre Kinder, viell. weil er in einer späteren Periode schreibt, I. Gardner, Z.P.E. 159 (2007), S. 225, Anm. 7.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(5840,'update','2014-02-05 11:58:04','2103','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:0:{}','bernini'),(5841,'update','2014-02-05 11:58:07','2103','Papyrillio\\BeehiveBundle\\Entity\\Correction',3,'a:0:{}','bernini'),(5842,'update','2014-02-05 11:58:19','2103','Papyrillio\\BeehiveBundle\\Entity\\Correction',4,'a:0:{}','bernini'),(5843,'update','2014-02-05 11:58:31','2103','Papyrillio\\BeehiveBundle\\Entity\\Correction',5,'a:0:{}','bernini'),(5844,'remove','2014-02-05 11:59:22','2103','Papyrillio\\BeehiveBundle\\Entity\\Correction',6,'N;','bernini'),(5845,'create','2014-02-06 13:02:57','1987','Papyrillio\\BeehiveBundle\\Entity\\Task',1,'a:2:{s:11:\"description\";s:36:\"Enter correction to DDbDP via editor\";s:7:\"cleared\";N;}','bernini'),(5846,'create','2014-02-06 13:02:57','2104','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";N;s:11:\"description\";s:78:\"Zu datieren: viell. auf 288-299 n.Chr., S. Bucking, Z.P.E. 159 (2007), S. 231.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(5847,'create','2014-02-06 13:14:34','2105','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";N;s:11:\"description\";s:156:\"Über die Gegenwart von O. Mich 1. 697 in dem Raum G des Haus 5002 in Karanis und die dazugehörig Schlüsse vgl. S. Bucking, Z.P.E. 159 (2007), S. 230-231.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(5848,'update','2014-02-06 13:14:56','2105','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:158:\"Über die Gegenwart von O. Mich 1. 697 in dem Raum G des Hauses 5002 in Karanis und die dazugehörig Schlüsse vgl. S. Bucking, Z.P.E. 159 (2007), S. 230-231.\";}','bernini'),(5849,'create','2014-02-07 14:55:35','2106','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";N;s:11:\"description\";s:44:\"Photo: S. Bucking Z.P.E. 159 (2007), S. 246.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(5850,'create','2014-02-07 15:21:04','2107','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";s:3:\"V°\";s:11:\"description\";s:91:\"Die Handschrift ist anders als der des 341, S. Bucking, Z.P.E. 159 (2007), S. 237, Anm. 39.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(5851,'update','2014-02-07 15:21:50','2107','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:108:\"Die Handschrift ist anders als der des 341, S. Bucking, Z.P.E. 159 (2007), S. 237, Anm. 39 (nach dem Photo).\";}','bernini'),(5852,'update','2014-02-07 15:23:30','2107','Papyrillio\\BeehiveBundle\\Entity\\Correction',3,'a:1:{s:11:\"description\";s:108:\"Die Handschrift ist anders als der des 341 (nach dem Photo), S. Bucking, Z.P.E. 159 (2007), S. 237, Anm. 39.\";}','bernini'),(5853,'update','2014-02-07 15:26:42','2040','Papyrillio\\BeehiveBundle\\Entity\\Correction',3,'a:1:{s:11:\"description\";s:103:\"Φλαουΐων → Φλ(αουΐων) (nach dem Photo), N. Gonis, Z.P.E. 159 (2007), S. 269, zu Z. 1.\";}','bernini'),(5854,'update','2014-02-07 15:27:23','2042','Papyrillio\\BeehiveBundle\\Entity\\Correction',3,'a:1:{s:11:\"description\";s:177:\"[Αὐρ(ήλιος) Μηνᾶς υἱὸς Π]άπα → [Αὐρήλιοι Μηνᾶς υἱὸ]ς̣ [Π]άπα (nach dem Photo), N. Gonis, Z.P.E. 159 (2007), S. 269, zu Z. 3.\";}','bernini'),(5855,'update','2014-02-07 15:28:05','2045','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:132:\"[ὑπογράφοντες → [ἑξῆς ὑπογράφοντες (nach dem Photo), N. Gonis, Z.P.E. 159 (2007), S. 269, zu Z. 5.\";}','bernini'),(5856,'update','2014-02-07 15:29:09','2046','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:149:\"καθοσιωμ(ένων) → καθοσιωμένων oder γενναιοτάτων (nach dem Photo), N. Gonis, Z.P.E. 159 (2007), S. 269, zu Z. 6.\";}','bernini'),(5857,'update','2014-02-07 15:29:50','2047','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:140:\"[ ± 16 ] → [Ἰωσὴφ(?) ἀπὸ τῆς αὐτῆς πόλε]ω̣ς (nach dem Photo), N. Gonis, Z.P.E. 159 (2007), S. 269, zu Z. 7.\";}','bernini'),(5858,'update','2014-02-07 15:30:28','2048','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:158:\"[ἐσχηκέναι παρὰ σοῦ] → [ἐσχηκέναι ἡμᾶς παρὰ σοῦ] (nach dem Photo), N. Gonis, Z.P.E. 159 (2007), S. 269, zu Z. 8.\";}','bernini'),(5859,'update','2014-02-07 15:31:16','1763','Papyrillio\\BeehiveBundle\\Entity\\Correction',4,'a:1:{s:11:\"description\";s:160:\"π̣ρ̣ο̣ενέγκας → παρ̣ενένκας (l. παρ̣ενέγκας) (am Original und nach dem Photo), A. Papathomas, Archiv 53 (2007), S. 182-183.\";}','bernini'),(5860,'update','2014-02-07 15:32:29','2026','Papyrillio\\BeehiveBundle\\Entity\\Correction',3,'a:1:{s:11:\"description\";s:142:\"Zu datieren auf der Ende des 1. oder auf der 1. Hälfte des 2. Jahrh. n.Chr. (nach dem Photo), D. Hagedorn Z.P.E. 159 (2007), S. 265, zu Z. 1.\";}','bernini'),(5861,'update','2014-02-07 15:33:20','2053','Papyrillio\\BeehiveBundle\\Entity\\Correction',3,'a:1:{s:11:\"description\";s:225:\"Die richtige Lesung ist Τ̣αύλου (l. Ταύρου), daher Flavius Septimius Taurus gemeint ist, wahr. dieselbe Person von P. Oxy. 7. 1033, Z. 3 (nach dem Photo; wie B.L. 13, S. ...), N. Gonis, Z.P.E. 159 (2007), S. 270.\";}','bernini'),(5862,'update','2014-02-07 15:34:30','2062','Papyrillio\\BeehiveBundle\\Entity\\Correction',4,'a:1:{s:11:\"description\";s:172:\"Der Text sollte als ein Petition verstanden werden: der Antragstellersname war in Z. 3, und ab Z. 4 gab es der Inhalt (nach dem Photo), N. Gonis, Z.P.E. 159 (2007), S. 271.\";}','bernini'),(5863,'update','2014-02-07 15:35:12','2063','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:84:\"Zu datieren: 5. Jahrh. n.Chr. (nach dem Photo), N. Gonis, Z.P.E. 159 (2007), S. 271.\";}','bernini'),(5864,'update','2014-02-07 15:36:08','2064','Papyrillio\\BeehiveBundle\\Entity\\Correction',3,'a:1:{s:11:\"description\";s:131:\"Ist nicht sicher wie viele Hände haben den Papyrus geschrieben, viell. drei (nach dem Photo), N. Gonis, Z.P.E. 159 (2007), S. 271.\";}','bernini'),(5865,'update','2014-02-07 15:36:47','2065','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:96:\"βουλε]υ̣τής → τα]ύ̣της (nach dem Photo), N. Gonis, Z.P.E. 159 (2007), S. 271.\";}','bernini'),(5866,'update','2014-02-07 15:37:24','2066','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:87:\"Keine Zeile verloren gewesen ist (nach dem Photo), N. Gonis, Z.P.E. 159 (2007), S. 271.\";}','bernini'),(5867,'update','2014-02-07 15:37:59','2067','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:101:\"Εὐ̣μ̣υ̣ρ̣ί(ας) → Σπανίας (nach dem Photo), N. Gonis, Z.P.E. 159 (2007), S. 271.\";}','bernini'),(5868,'update','2014-02-07 15:38:38','2068','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:121:\"Καιλα̣|π̣[ο]τ̣ει → viell. Καλλα|π  ̣  ̣ει (nach dem Photo), N. Gonis, Z.P.E. 159 (2007), S. 271.\";}','bernini'),(5869,'update','2014-02-07 15:39:33','2069','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:221:\"[ ±17 ] ἀ̣π̣ὸ τοῦ μηνός → [ὑμῶν Abstrakt ἀπὸ τοῦ] ὄ̣ντος μηνός; daher das Objekt des Mietvertrags war wahr. ein Gebäude (nach dem Photo), N. Gonis, Z.P.E. 159 (2007), S. 271.\";}','bernini'),(5870,'update','2014-02-07 15:40:25','2070','Papyrillio\\BeehiveBundle\\Entity\\Correction',3,'a:1:{s:11:\"description\";s:119:\"Bevor Σχολαστικίῳ der Papyrus hat ἀ̣δελφ(ῷ) (nach dem Photo), N. Gonis, Z.P.E. 159 (2007), S. 271.\";}','bernini'),(5871,'update','2014-02-07 15:41:00','2071','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:105:\"Nach κόμε(τι) der Papyrus hat † π(αρά) (nach dem Photo), N. Gonis, Z.P.E. 159 (2007), S. 271.\";}','bernini'),(5872,'update','2014-02-07 15:42:31','1749','Papyrillio\\BeehiveBundle\\Entity\\Correction',4,'a:1:{s:11:\"description\";s:901:\"Χαιρήμω[ν Ἀπολλωνίῳ τῷ φι]λτ[ά]τωι χαίρειν. | οὐκ ἀλλότρι[ο]ν [ ±12 τῆς] εἰς μὲ φιλοφροσύ|νης ποιεῖς φ[± 12 ]  ̣ο  ̣  ̣ ἀμνημονήσας τῆς | πρὸς σέ μου [ ± 11 ]  ̣ς, ἄδελφε, π[ρ]οσεπιπαρα|κληθεὶς δ[ ± 11 ] ἐργοιφ[ί]οις → Χαιρήμ̣ων̣ [Ἀπολλωνίῳ τῷ φι]λ̣τά̣τωι̣ χαίρ̣ειν. | οὐκ ἀλλότρι̣ο̣ν [τοῦ ἤθους σου τῆς τε] εἰς μὲ φιλοφροσύ|νης ποιεῖς, φ[ίλτατε ± 6 ]  ̣οὐ̣κ̣ ἀμν̣ημ̣ονήσας τῆς | πρὸς σέ μου ἐ̣[μφύτου στοργ]ῆ̣ς, ἄδελφ̣ε̣, π[ρ]ο̣σεπιπαρα|κληθεὶς δι’ ω[ ± 10 ] ἐργοιφ[ί]οις (am Original), A. Papathomas, Archiv 53 (2007), S. 182-183.\";}','bernini'),(5873,'update','2014-02-07 15:43:34','1750','Papyrillio\\BeehiveBundle\\Entity\\Correction',3,'a:1:{s:11:\"description\";s:86:\"κοινοῦ → κή̣που (am Original), A. Papathomas, Archiv 53 (2007), S. 183.\";}','bernini'),(5874,'update','2014-02-07 15:44:03','1751','Papyrillio\\BeehiveBundle\\Entity\\Correction',3,'a:1:{s:11:\"description\";s:101:\"κόμιζέ μοι → κομίζει μοι (am Original), A. Papathomas, Archiv 53 (2007), S. 183.\";}','bernini'),(5875,'update','2014-02-07 15:44:35','1752','Papyrillio\\BeehiveBundle\\Entity\\Correction',4,'a:1:{s:11:\"description\";s:222:\"† [τ]ῷ [τ(  ̣  ̣  ̣)τ]ν τ(  ̣  ̣  ̣) μεγαλοπρε(πεστάτῳ) → †̣ τ̣ῷ̣ τ̣[ὰ] π̣άντα μεγαλοπρε(πεστάτῳ) (am Original), A. Papathomas, Archiv 53 (2007), S. 183.\";}','bernini'),(5876,'update','2014-02-07 15:45:03','1787','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"descrip