','Papyrillio\\BeehiveBundle\\Entity\\Correction',4,'a:1:{s:11:\"description\";s:128:\"̣  ̣  ̣β̣α̣ν̣ο̣υ̣ → Σ̣ι̣λ̣β̣α̣ν̣ο̣ῦ̣ (am Original), A. Papathomas, Archiv 53 (2007), S. 197-198.\";}','bernini'),(5899,'update','2014-02-07 15:59:03','1782','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:125:\"λοιπάς ist nachträglich oberhalb von ἑκατόν geschrieben (am Original), A. Papathomas, Archiv 53 (2007), S. 198.\";}','bernini'),(5900,'update','2014-02-07 15:59:34','1783','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:268:\"πάλ̣α̣ι ἐμοὶ | τὴν αιτ  ̣  ̣[  ̣  ̣] ἐπιλείψῃς → πάλ̣α̣ι ἐμοὶ | τὴν αἰτε̣ί̣α̣[ν] (l. αἰτίαν) ἐπιρείψῃς (l. ἐπιρρίψεις) (am Original), A. Papathomas, Archiv 53 (2007), S. 198.\";}','bernini'),(5901,'update','2014-02-07 16:00:20','1784','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:106:\"σῖτον → σεῖτον (l. σῖτον) (am Original), A. Papathomas, Archiv 53 (2007), S. 198-199.\";}','bernini'),(5902,'update','2014-02-07 16:00:49','1785','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:100:\"αὐτ̣ό̣ν̣ → αὐτ̣ή̣ν̣ (am Original), A. Papathomas, Archiv 53 (2007), S. 198 -199.\";}','bernini'),(5903,'update','2014-02-07 16:01:15','1786','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:174:\"πολλάκι<ς> σοι δὲ γεγράφη̣[κ]α̣ → πολλάκις οἵδε γεγραφή̣[κ]α̣[σι] (am Original), A. Papathomas, Archiv 53 (2007), S. 199.\";}','bernini'),(5904,'update','2014-02-07 16:02:07','2096','Papyrillio\\BeehiveBundle\\Entity\\Correction',3,'a:1:{s:11:\"description\";s:233:\"η̣ → die Lesung der Jahreszahl ist falsch; der Papyrus sollte an der Ende einer Regierungsjahres zwischen 88 und 96 n.Chr. datiert werden (am Original geprüft von R. Scholl und nach Photo), D. Hagedorn Z.P.E. 159 (2007), S. 264.\";}','bernini'),(5905,'update','2014-02-07 16:02:37','2035','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:10