 x 7.6 cm), I. Gardner, ZPE 159 (2007), S. 225 mit Anm. 8.\";}','bernini'),(5913,'update','2014-02-10 09:39:44','2107','Papyrillio\\BeehiveBundle\\Entity\\Correction',4,'a:1:{s:11:\"description\";s:110:\"Die Schreiberhand ist anders als der des 341 (nach dem Photo), S. Bucking, Z.P.E. 159 (2007), S. 237, Anm. 39.\";}','bernini'),(5914,'create','2014-02-10 09:52:39','2110','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";s:3:\"1-7\";s:11:\"description\";s:132:\"Die Schreiberhand ist dieselbe von M.P.E.R. 15. 106 (vgl. auch M.P.E.R. 15., S. 92), S. Bucking, Z.P.E. 159 (2007), S. 239, Anm. 49.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(5915,'create','2014-02-10 10:12:11','2111','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";N;s:11:\"description\";s:160:\"Viell. der Papyrus, und auch SB 18. 13247 und C.P.R. 22. 18 könnte aus dem Büro von Yahya ibn Hilal kommen, S. Bucking, Z.P.E. 159 (2007), S. 239 mit Anm. 49.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(5916,'update','2014-02-10 10:19:24','2110','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:132:\"Die Schreiberhand ist dieselbe von M.P.E.R. 18. 133 (vgl. auch M.P.E.R. 15., S. 92), S. Bucking, Z.P.E. 159 (2007), S. 239, Anm. 49.\";}','bernini'),(5917,'create','2014-02-10 10:54:05','2112','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";N;s:11:\"description\";s:129:\"Die Hand die hat den Griechische und den Koptische Texten geschrieben ist viell. dieselbe, S. Bucking, Z.P.E. 159 (2007), S. 239.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(5918,'create','2014-02-10 11:18:03','2113','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";N;s:11:\"description\";s:116:\"Der Papyrus kann an das Büro des Yahya ibn Hilal indirekt verknüpft werden, S. Bucking, Z.P.E. 159 (2007), S. 239.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(5919,'create','2014-02-10 11:57:26','2114','Papyrillio\