,'2149','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";s:1:\"3\";s:11:\"description\";s:124:\"Ἀγο(ρῶν) ͞β → Ἀγ(ορῶν) Βο̣(ρρᾶ) oder Β(ορρᾶ), D. Hagedorn, Tyche 22 (2007), S. 44, Anm. 40.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(6081,'update','2014-02-24 15:14:40','2149','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:122:\"Ἀγο(ρῶν) β → Ἀγ(ορῶν) Βο̣(ρρᾶ) oder Β(ορρᾶ), D. Hagedorn, Tyche 22 (2007), S. 44, Anm. 40.\";}','bernini'),(6082,'create','2014-02-24 15:18:23','2007','Papyrillio\\BeehiveBundle\\Entity\\Task',1,'a:2:{s:11:\"description\";s:36:\"Enter correction to DDbDP via editor\";s:7:\"cleared\";N;}','bernini'),(6083,'create','2014-02-24 15:18:23','2150','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";s:3:\"1-2\";s:11:\"description\";s:562:\"Πό̣σ̣τ̣ο̣μ̣(ος) ὃ̣ς καὶ [Ὧ]ρο(ς) πράκ(τωρ) | ἀργ(υρικῶν) Ἀγο̣(ρῶν) βο̣(ρρᾶ) wurde von Ch. Armoni, O.Heid. 195,3 Komm. nach dem Photo auf diese Weise korrigiert: Πό̣σ̣τ̣ο̣μ̣(ος) ὁ̣ καὶ [Ὧ]ρο(ς) πράκ(τωρ) | ἀργ(υρικῶν) Ἀγο̣(ρῶν) ͞β, aber statt Ἀγο̣(ρῶν) βο̣(ρρᾶ) ist ein Personenname, viell. Ἁρ̣θ̣ῷ̣(τῃ), zu lesen, und dementsprechend Ἰμούθ(ου) statt Ἰμούθ(ῃ), D. Hagedorn, Tyche 22 (2007), S. 39, Anm. 10.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(6084,'update','2014-02-24 15:23:27','2150','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:556:\"Πό̣σ̣τ̣ο̣μ̣(ος) ὃ̣ς καὶ [Ὧ]ρο(ς) πράκ(τωρ) | ἀργ(υρικῶν) Ἀγο̣(ρῶν) βο̣(ρρᾶ) wurde von Ch. Armoni, O.Heid. 195,3 Komm. nach dem Photo auf diese Weise korrigiert: Πό̣σ̣τ̣ο̣μ̣(ος) ὁ̣ καὶ [Ὧ]ρο(ς) πράκ(τωρ) | ἀργ(υρικῶν) Ἀγο̣(ρῶν) ͞β, aber statt Ἀγο̣(ρῶν)  ͞β steht der Name des Zahlers, z.B. Ἁρ̣θ̣ῷ̣(τῃ), zu lesen, und dementsprechend Ἰμούθ(ου) statt Ἰμούθ(ῃ), D. Hagedorn, Tyche 22 (2007), S. 39, Anm. 10.\";}','bernini'),(6085,'update','2014-02-24 15:24:01','2150','Papyrillio\\BeehiveBundle\\Entity\\Correction',3,'a:1:{s:11:\"description\";s:578:\"Πό̣σ̣τ̣ο̣μ̣(ος) ὃ̣ς καὶ [Ὧ]ρο(ς) πράκ(τωρ) | ἀργ(υρικῶν) Ἀγο̣(ρῶν) βο̣(ρρᾶ) wurde von Ch. Armoni, O.Heid. 195,3 Komm. nach dem Photo auf diese Weise korrigiert: Πό̣σ̣τ̣ο̣μ̣(ος) ὁ̣ καὶ [Ὧ]ρο(ς) πράκ(τωρ) | ἀργ(υρικῶν) Ἀγο̣(ρῶν) ͞β, aber statt Ἀγο̣(ρῶν)  ͞β steht der Name des Zahlers, z.B. Ἁρ̣θ̣ῷ̣(τῃ), zu lesen, und dementsprechend Ἰμούθ(ου) statt Ἰμούθ(ῃ) (der Name des Vaters), D. Hagedorn, Tyche 22 (2007), S. 39, Anm. 10.\";}','bernini'),(6086,'create','2014-02-24 15:29:59','2008','Papyrillio\\BeehiveBundle\\Entity\\Task',1,'a:2:{s:11:\"description\";s:36:\"Enter correction to DDbDP via editor\";s:7:\"cleared\";N;}','bernini'),(6087,'create','2014-02-24 15:29:59','2151','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";s:1:\"1\";s:11:\"description\";s:122:\"Erg. viell. πράκτ̣[ωρ ἀργ(υρικῶν) Ἀγο(ρῶν) ͞β], D. Hagedorn, Tyche 22 (2007), S. 41, Anm. 35.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(6088,'create','2014-02-24 15:42:21','2009','Papyrillio\\BeehiveBundle\\Entity\\Task',1,'a:2:{s:11:\"description\";s:36:\"Enter correction to DDbDP via editor\";s:7:\"cleared\";N;}','bernini'),(6089,'create','2014-02-24 15:42:21','2152','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";s:1:\"1\";s:11:\"description\";s:105:\"μη(τροπόλεως) ist zu dieser Zeit ungebräuchlich, D. Hagedorn, Tyche 22 (2007), S. 38, Anm. 8.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(6090,'create','2014-02-24 15:48:18','2010','Papyrillio\\BeehiveBundle\\Entity\\Task',1,'a:2:{s:11:\"description\";s:36:\"Enter correction to DDbDP via editor\";s:7:\"cleared\";N;}','bernini'),(6091,'create','2014-02-24 15:48:18','2153','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";s:1:\"1\";s:11:\"description\";s:111:\"μ̣η̣τ̣(ροπόλεως) ist zu dieser Zeit ungebräuchlich, D. Hagedorn, Tyche 22 (2007), S. 38, Anm. 8.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(6092,'create','2014-02-24 15:56:12','2011','Papyrillio\\BeehiveBundle\\Entity\\Task',1,'a:2:{s:11: