by him, but no explanation is given about it]\";}','bernini'),(6283,'update','2014-03-06 11:52:16','2240','Papyrillio\\BeehiveBundle\\Entity\\Correction',4,'a:1:{s:11:\"description\";s:392:\"μακαρ(ιωτά)τ(ου) → μακαρίτ(ου), N. Gonis, Tyche 22 (2007), S. 216. [Gonis writes μακ(αρί)τ(ου) for both this papyrus and SPP III 115,8, but I guess he uses the brackets referring just to the second papyrus (where μακ(αριω)τ(άτου )is written), otherwise alpha and rho would be considered part of the abbreviation by him, but no explanation is given]\";}','bernini'),(6284,'create','2014-03-06 12:01:05','2057','Papyrillio\\BeehiveBundle\\Entity\\Task',1,'a:2:{s:11:\"description\";s:36:\"Enter correction to DDbDP via editor\";s:7:\"cleared\";N;}','bernini'),(6285,'create','2014-03-06 12:01:05','2241','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";s:1:\"8\";s:11:\"description\";s:91:\"μακ(αριω)τ(άτου) → μακ(αρί)τ(ου), N. Gonis, Tyche 22 (2007), S. 216.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(6286,'update','2014-03-06 14:52:20','1763','Papyrillio\\BeehiveBundle\\Entity\\Correction',5,'a:1:{s:11:\"description\";s:154:\"π̣ρ̣ο̣ενέγκας → παρ̣ενένκας (l. παρενέγκας) (am Original und nach dem Photo), A. Papathomas, Archiv 53 (2007), S. 188.\";}','bernini'),(6287,'update','2014-03-06 15:00:45','2096','Papyrillio\\BeehiveBundle\\Entity\\Correction',5,'a:1:{s:11:\"description\";s:237:\"η̣: die Lesung der Jahreszahl ist falsch; daher ist der Papyrus an der Ende einer Regierungsjahres zwischen 88 und 96 n.Chr. zu datieren (am Original geprüft von R. Scholl und nach einem Photo), D. Hagedorn, Z.P.E. 159 (2007), S. 264.\";}','bernini'),(6288,'update','2014-03-06 15:04:06','2093','Papyrillio\\BeehiveBundle\\Entity\\Correction',3,'a:1:{s:11:\"description\";s:96:\"Der Text liegt an dem Verso (nach einem Photo), D. Hagedorn, Z.P.E. 159 (2007), S. 264, Anm. 19.\";}','bernini'),(6289,'update','2014-03-06 15:04:47','2094','Papyrillio\\BeehiveBundle\\Entity\\Correction',3