";}','bernini'),(6297,'update','2014-03-06 15:18:00','2172','Papyrillio\\BeehiveBundle\\Entity\\Correction',3,'a:1:{s:11:\"description\";s:110:\"Ἀσκ(λᾶς) → Ἀμ̣ώ̣νι\\ο/(ς) (nach einem Photo), D. Hagedorn, Tyche 22 (2007), S. 42, Anm. 37.\";}','bernini'),(6298,'update','2014-03-06 15:18:43','2173','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:247:\"Ἀσκ(λᾶς) σεση(μείωμαι) → viell. Ἀ̣μ̣ώ̣(νιος) σ̣ε̣σ̣η̣(μείωμαι): mit Sicherheit ist er nicht das Praktorenpaar der Jahre 139-140 n.Chr. (nach einem Photo), D. Hagedorn, Tyche 22 (2007), S. 42, Anm. 37.\";}','bernini'),(6299,'update','2014-03-06 15:20:12','2181','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:269:\"Ἀγο(ρῶν) β → Ἀγο(ρῶν) Βο(ρρᾶ), daher soll nicht der Text angesehen müssen als die älteste Zeugnis für Ἀγο(ραὶ) ͞β, gegen B. Palme, Tyche 4 (1989), S. 127 mit Anm. 16 (nach einem Photo), D. Hagedorn, Tyche 22 (2007), S. 43, Anm. 40.\";}','bernini'),(6300,'update','2014-03-06 15:22:33','2158','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:153:\"Ἀγο(ρῶν) ϛ (ἔτους) → wohl Ἀγο(ρῶν) Βο(ρρᾶ) ϛ (ἔτους) (nach dem Photo), D. Hagedorn, Tyche 22 (2007), S. 37, Anm. 6.\";}','bernini'),(6301,'update','2014-03-06 15:23:13','2159','Papyrillio\\BeehiveBundle\\Entity\\Correction',3,'a:1:{s:11:\"description\";s:243:\"Ἀ̣γο(ρῶν) β(ορρᾶ) → Ἀ̣γ̣ο̣(ρῶν) ͞β oder der abgekürzt Name des Zahlers (aber μ̣η̣τ̣(ροπόλεως) ist nicht völlig zu ausschließen) (nach einem Photo), D. Hagedorn, Tyche 22 (2007), S. 38-39, Anm. 10.\";}','bernini'),(6302,'update','2014-03-06 15:24:04','2160','Papyrillio\\BeehiveBundle\\Entity\\Correction',3,'a:1:{s:11:\"description\";s:93:\"(τριώβολον) → ε (nach einem Photo), D. Hagedorn, Tyche 22 (2007), S. 44, Anm. 42.\";}','bernini'),(6303,'update','2014-03-06 15:24:49','2140','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:255:\"μη̣(τροπόλεως) in der Z. 2 ist wirklich unsicher: vermutlich steht