:48:48','2251','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";s:2:\"27\";s:11:\"description\";s:100:\"Ἀμαραντῷ → Ἀμαράντωι (nach dem Photo), A. Papathomas, Tyche 22 (2007), S. 218.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(6328,'create','2014-03-07 16:09:52','2060','Papyrillio\\BeehiveBundle\\Entity\\Task',1,'a:2:{s:11:\"description\";s:36:\"Enter correction to DDbDP via editor\";s:7:\"cleared\";N;}','bernini'),(6329,'create','2014-03-07 16:09:52','2252','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";s:1:\"9\";s:11:\"description\";s:679:\"οὐκέτι δὲ ἐφρόντεισεν τὸ σὸν μέγεθος περὶ τοῦ ταπιτιούχου (l. ταπητιούχου ?) πώλου | τῆς σῆς δὲ μεγαλοπρεπείας δούλου Μακαρίου → οὐκέτι δὲ ἐφρόντ{ε}ισεν τὸ σὸν μέγεθος περὶ τοῦ ταπιτίου (l. ταπητίου) τοῦ Παύλου, | τῆς σῆς δὲ μεγαλοπρεπείας δούλου μακαρίου, „Deine Erhabenheit hat sich nicht um den Teppich [bzw. die Decke] des Paulus gekümmert, des Dieners Deiner Magnifizenz, des Seligen“ (nach dem Photo), A. Papathomas, Tyche 22 (2007), S. 218-219.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(6330,'create','2014-03-07 16:31:19','2061','Papyrillio\\BeehiveBundle\\Entity\\Task',1,'a:2:{s:11:\"description\";s:36:\"Enter correction to DDbDP via editor\";s:7:\"cleared\";N;}','bernini'),(6331,'create','2014-03-07 16:31:19','2253','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";s:2:\"11\";s:11:\"description\";s:276:\"τῷ πάντων → τὰ πάντα (nach dem Photo), A. Papathomas, Tyche 22 (2007), S. 219. [Papathomas and ZPE 165, p. 131 assert the ed.pr. text to be τῶν πάντων, but the paper edition has the dative singular, and according to BL it has never been corrected]\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(6332,'update','2014-03-07 16:32:07','2253','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:261:\"τῷ πάντων → τὰ πάντα (nach dem Photo), A. Papathomas, Tyche 22 (2007), S. 219. [Papathomas and ZPE 165, p. 131 assert the ed.pr. text to be τῶν πάντων, but it has the dative singular, and according to BL it has never been corrected]\";}','bernini'),(6333,'create','2014-03-07 16:40:28','2062','Papyrillio\\BeehiveBundle\\Entity\\Task',1,'a:2:{s:11:\"description\";s:36:\"Enter correction to DDbDP via editor\";s:7:\"cleared\";N;}','bernini'),(6334,'create','2014-03-07 16:40:28','2254','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";s:1:\"1\";s:11:\"description\";s:65:\"μεταξύ → μετοξύ (l. μεταξύ) (nach dem Photo),\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(6335,'update','2014-03-07 16:42:41','2254','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:106:\"μεταξύ → μετοξύ (l. μεταξύ) (nach dem Photo), A. Papathomas, Tyche 22 (2007), S. 219. \";}','bernini'),(6336,'create','2014-03-07 16:46:41','2255','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";s:1:\"3\";s:11:\"description\";s:217:\"τοῦ μέτρου ἐμβαλαμένου (l. ἐμβαλομένου) → τοῦ μέτρου τοῦ ἐμβαλαμένου (l. ἐμβαλομένου) (nach dem Photo), A. Papathomas, Tyche 22 (2007), S. 219.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(6337,'create','2014-03-07 16:53:30','2063','Papyrillio\\BeehiveBundle\\Entity\\Task',1,'a:2:{s:11:\"description\";s:36:\"Enter correction to DDbDP via editor\";s:7:\"cleared\";N;}','bernini'),(6338,'create','2014-03-07 16:53:30','2256','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";s:2:\"24\";s:11:\"description\";s:94:\"γράψον → γράψα̣ι̣ (nach dem Photo) A. Papathomas, Tyche 22 (2007), S. 219-220.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(6339,'update','2014-03-07 16:55:30','1008','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:117:\"Ὑ̣ψ̣ί̣σ̣[το]υ: viell. Σ̣ε̣ρ̣ή̣[νο]υ (nach einem Photo), R. Ast, Z.P.E. 153 (2005), S. 161-162.\";}','bernini'),(6340,'update','2014-03-10 09:35:31','2136','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:106:\"ἐ̣φ’ → ὑ̣φ’ (vgl. ed.pr., Komm. ad loc.), S. Bucking, Z.P.E. 159 (2007), S. 235 mit Anm. 32.\";}','bernini'),(6341,'update','2014-03-10 09:35:57','2137','Papyrillio\\BeehiveBundle\\Entity\\Correction',3,'a:1:{s:11:\"description\";s:190:\"Die Formeln des „corn dole“ Archivs wurden an dem Phylarchos (der die Listen schreib) übermittelt, viell. durch die überlegene Zentralkommission, S. Bucking, Z.P.E. 159 (2007), S. 235.\";}','bernini'),(6342,'update','2014-03-10 09:36:27','2111','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:162:\"Viell. der Papyrus, und auch S.B. 18. 13247 und C.P.R. 22. 18 könnte aus dem Büro von Yahya ibn Hilal kommen, S. Bucking, Z.P.E. 159 (2007), S. 239 mit Anm. 49.\";}','bernini'),(6343,'update','2014-03-10 09:36:57','2106','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:45:\"Photo: S. Bucking, Z.P.E. 159 (2007), S. 246.\";}','bernini'),(6344,'create','2014-03-10 10:45:51','2064','Papyrillio\\BeehiveBundle\\Entity\\Task',1,'a:2:{s:11:\"description\";s:36:\"Enter correction to DDbDP via editor\";s:7:\"cleared\";N;}','bernini'),(6345,'create','2014-03-10 10:45:51','2257','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";s:3:\"3-4\";s:11:\"description\";s:157:\"πρὸς τ̣[ὴν τοῦ] | θ (ἔτους) → πρὸς τ̣[ὸ] | θ (ἔτος) (wie bereits B.L. 2.2, S. 49), P. Sänger, Tyche 22 (2007), S. 221.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(6346,'update','2014-03-10 12:30:58','419','Papyrillio\\BeehiveBundle\\Entity\\Correction',7,'a:1:{s:11:\"description\";s:71:\"Nd. mit italienischer Übersetzung: M. Rolandi, Aeg. 85 (2005), S. 260.\";}','bernini'),(6347,'update','2014-03-10 12:31:21','417','Papyrillio\\BeehiveBundle\\Entity\\Correction',3,'a:1:{s:11:\"description\";s:75:\"Nd. mit italienischer Übersetzung: M. Rolandi, Aeg. 85 (2005), S. 254-255.\";}','bernini'),(6348,'update','2014-03-10 12:31:40','418','Papyrillio\\BeehiveBundle\\Entity\\Correction',3,'a:1:{s:11:\"description\";s:75:\"Nd. mit italienischer Übersetzung: M. Rolandi, Aeg. 85 (2005), S. 256-257.\";}','bernini'),(6349,'update','2014-03-10 12:32:02','420','Papyrillio\\BeehiveBundle\\Entity\\Correction',3,'a:1:{s:11:\"description\";s:75:\"Nd. mit italienischer Übersetzung: M. Rolandi, Aeg. 85 (2005), S. 263-265.\";}','bernini'),(6350,'update','2014-03-10 12:32:36','515','Papyrillio\\BeehiveBundle\\Entity\\Correction',3,'a:1:{s:11:\"description\";s:194:\"Ζευτλω Φακ|οῦ (B.L. 12, S. 311) ist identisch mit Σουθλου Φακοῦ in O. Schøyen 10 (Aeg. 84, 2004, S. 171-172), und zum Namen vgl. G. Messeri, Aeg. 86 (2006), S. 163-164.\";}','bernini'),(6351,'update','2014-03-10 12:38:47','2113','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:149:\"Der Papyrus kann an das Büro des Yahya ibn Hilal indirekt verknüpft werden, S. Bucking, Z.P.E. 159 (2007), S. 239. [is this correction necessary??]\";}','bernini'),(6352,'update','2014-03-10 12:39:33','1279','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:41:\"Vgl. N. Gonis, Z.P.E. 150 (2004), S. 193.\";}','bernini'),(6353,'update','2014-03-10 12:40:52','2253','Papyrillio\\BeehiveBundle\\Entity\\Correction',3,'a:1:{s:11:\"description\";s:264:\"τῷ πάντων → τὰ πάντα (nach dem Photo), A. Papathomas, Tyche 22 (2007), S. 219. [Papathomas and Z.P.E. 165, p. 131 assert the ed.pr. text to be τῶν πάντων, but it has the dative singular, and according to BL it has never been corrected]\";}','bernini'),(6354,'update','2014-03-10 12:41:54','2102','Papyrillio\\BeehiveBundle\\Entity\\Correction',3,'a:1:{s:11:\"description\";s:347:\"Die Adresse geschrieben auf Syrisch bezeichnet wahr. den Namen des Empfängers, denn man kann denken dass auch der Name des Empfängers war auf Griechisch geschrieben, „An Theognostos“ (dies bedeutet, das verlorene Teil war mehr erheblich, und die ursprünglichen Dimensionen ca. 28 x 7.6 cm), I. Gardner, Z.P.E. 159 (2007), S. 225 mit Anm. 8.\";}','bernini'),(6355,'update','20