iveBundle\\Entity\\Correction',6,'a:1:{s:11:\"description\";s:194:\"[Αὐρ(ήλιος) Μηνᾶς υίὸς Π]άπα (B.L. 1, S. 42) → [Αὐρήλιοι Μηνᾶς υἱὸ]ς̣ [Π]άπα (nach dem Photo), N. Gonis, Z.P.E. 159 (2007), S. 269, zu Z. 3.\";}','cowey'),(6511,'update','2014-04-03 16:25:11','2044','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:6:\"status\";s:8:\"reviewed\";}','cowey'),(6512,'create','2014-04-07 09:40:07','2090','Papyrillio\\BeehiveBundle\\Entity\\Task',1,'a:2:{s:11:\"description\";s:36:\"Enter correction to DDbDP via editor\";s:7:\"cleared\";N;}','bernini'),(6513,'create','2014-04-07 09:40:07','2291','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";s:2:\"12\";s:11:\"description\";s:81:\"ἀποδώσω → διδόναι, A. Benaissa, Tyche 21 (2006), S. 8, zu Z. 33.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(6514,'update','2014-04-07 09:42:28','2291','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:86:\"ἀποδώσω → διδόναι, A. Benaissa, Tyche 21 (2006), S. 8, Anm. zu Z. 33.\";}','bernini'),(6515,'create','2014-04-07 09:57:29','2292','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";s:2:\"16\";s:11:\"description\";s:91:\"25 metra entsprechend 3,6 artabae 18 choinikes, A. Benaissa, Tyche 21 (2006), S. 9, Anm. 8.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(6516,'create','2014-04-07 10:29:25','2293','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";s:2:\"23\";s:11:\"description\";s:174:\"[ὡς (ἐτῶν)] ξϛ → ὡς (ἐτῶν) ξθ, P. Heilporns Bemerkung im Internet. [see http://wwwapp.cc.columbia.edu/ldpd/apis/item?mode=item&key=michigan.apis.2544]\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(6517,'create','2014-04-08 12:22:49','2294','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";N;s:11:\"description\";s:97:\"Nd. mit Photo und deutscher Übersetzung: F. Mitthof, Tyche 21 (2006), S. 171 und Taf. 16, Nr. 2.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(6518,'create','2014-04-08 15:27:22','2091','Papyrillio\\BeehiveBundle\\Entity\\Task',1,'a:2:{s:11:\"description\";s:36:\"Enter correction to DDbDP via editor\";s:7:\"cleared\";N;}','bernini'),(6519,'create','2014-04-08 15:27:22','2295','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";s:1:\"7\";s:11:\"description\";s:90:\"ἐκ τοῦ Δ[ί]ου → ἐκ τοῦ σ̣οῦ, Ch. Armoni, Tyche 21 (2006), S. 195.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(6520,'update','2014-04-08 15:27:47','2295','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:107:\"ἐκ τοῦ Δ[ί]ου → ἐκ τοῦ σ̣οῦ (nach dem Photo), Ch. Armoni, Tyche 21 (2006), S. 195.\";}','bernini'),(6521,'create','2014-04-08 15:31:02','2296','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";N;s:11:\"description\";s:65:\"Zu datieren: 221-203 v.Chr., Ch. Armoni, Tyche 21 (2006), S. 195.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(6522,'create','2014-04-08 15:35:42','2092','Papyrillio\\BeehiveBundle\\Entity\\Task',1,'a:2:{s:11:\"description\";s:36:\"Enter correction to DDbDP via editor\";s:7:\"cleared\";N;}','bernini'),(6523,'create','2014-04-08 15:35:42','2297','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";s:1:\"7\";s:11:\"description\";s:124:\"Δ̣  ̣  ̣  ̣[  ̣  ̣  ̣]ου ist wahr. derselbe Ἀσκληπιάδης vom Z. 9, Ch. Armoni, Tyche 21 (2006), S. 195.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(6524,'update','2014-04-08 15:36:56','2297','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:160:\"Δ̣  ̣  ̣  ̣[  ̣  ̣  ̣]ου → Α̣  ̣  ̣  ̣[  ̣  ̣  ̣]ου: wahr. derselbe Ἀσκληπιάδης vom Z. 9, Ch. Armoni, Tyche 21 (2006), S. 195.\";}','bernini'),(6525,'update','2014-04-08 15:38:29','2090','Papyrillio\\BeehiveBundle\\Entity\\Correction',4,'a:1:{s:11:\"description\";s:107:\"Die Kolumne ist wahrscheinlich auf 27.7-15.8.139 n.Chr. zu datieren, F. Mitthof, Z.P.E. 159 (2007), S. 257.\";}','bernini'),(6526,'update','2014-04-08 15:38:47','2043','Papyrillio\\BeehiveBundle\\Entity\\Correction',5,'a:1:{s:11:\"description\";s:181:\"ὁρμώμ(ενοι) wird abgelehnt: wahrscheinlich ein Verweis auf die Arbeit von der Aurelii sollte in die Lücke integriert werden, N. Gonis, Z.P.E. 159 (2007), S. 269, zu Z. 4.\";}','bernini'),(6527,'update','2014-04-08 15:39:11','2297','Papyrillio\\BeehiveBundle\\Entity\\Correction',3,'a:1:{s:11:\"description\";s:169:\"Δ̣  ̣  ̣  ̣[  ̣  ̣  ̣]ου → Α̣  ̣  ̣  ̣[  ̣  ̣  ̣]ου: wahrscheinlich derselbe Ἀσκληπιάδης vom Z. 9, Ch. Armoni, Tyche 21 (2006), S. 195.\";}','bernini'),(6528,'update','2014-04-08 15:39:42','2010','Papyrillio\\BeehiveBundle\\Entity\\Correction',3,'a:1:{s:11:\"description\";s:315:\"συναγτικός (l. συνακτικός) → συρ̣ι̣ατ̣τικός (l. συριατικός): der Ausdruck ἀναγνώστης συριατικός bedeutet dass Ision ist ein Leser von Syrischen Texte (hochwahrscheinlich Kanonische) in der Kirche geworden, I. Gardner, Z.P.E. 159 (2007), S. 223-227.\";}','bernini'),(6529,'update','2014-04-08 15:40:07','2102','Papyrillio\\BeehiveBundle\\Entity\\Correction',4,'a:1:{s:11:\"description\";s:356:\"Die Adresse geschrieben auf Syrisch bezeichnet wahrscheinlich den Namen des Empfängers, denn man kann denken dass auch der Name des Empfängers war auf Griechisch geschrieben, „An Theognostos“ (dies bedeutet, das verlorene Teil war mehr erheblich, und die ursprünglichen Dimensionen ca. 28 x 7.6 cm), I. Gardner, Z.P.E. 159 (2007), S. 225 mit Anm. 8.\";}','bernini'),(6530,'update','2014-04-08 15:40:26','2053','Papyrillio\\BeehiveBundle\\Entity\\Correction',4,'a:1:{s:11:\"description\";s:234:\"Die richtige Lesung ist Τ̣αύλου (l. Ταύρου), daher Flavius Septimius Taurus gemeint ist, wahrscheinlich dieselbe Person von P. Oxy. 7. 1033, Z. 3 (nach dem Photo; wie B.L. 13, S. ...), N. Gonis, Z.P.E. 159 (2007), S. 270.\";}','bernini'),(6531,'update','2014-04-08 15:40:46','2069','Papyrillio\\BeehiveBundle\\Entity\\Correction',3,'a:1:{s:11:\"description\";s:230:\"[ ±17 ] ἀ̣π̣ὸ τοῦ μηνός → [ὑμῶν Abstrakt ἀπὸ τοῦ] ὄ̣ντος μηνός; daher das Objekt des Mietvertrags war wahrscheinlich ein Gebäude (nach dem Photo), N. Gonis, Z.P.E. 159 (2007), S. 271.\";}','bernini'),(6532,'create','2014-04-08 15:51:15','2093','Papyrillio\\BeehiveBundle\\Entity\\Task',1,'a:2:{s:11:\"description\";s:36:\"Enter correction to DDbDP via editor\";s:7:\"cleared\";N;}','bernini'),(6533,'create','2014-04-08 15:51:15','2298','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";s:2:\"11\";s:11:\"description\";s:179:\"(ἔτους) κ Μ̣εχ(είρ) → (ἔτους) κδ Μ̣εχ(είρ) (nach dem Photo), daher ist der Text um 15.3.157 v.Chr. zu datieren, Ch. Armoni, Tyche 21 (2006), S. 195.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(6534,'update','2014-04-08 15:57:51','2096','Papyrillio\\BeehiveBundle\\Entity\\Correction',6,'a:1:{s:11:\"description\";s:234:\"η̣: die Lesung der Jahreszahl ist falsch; daher ist der Text an der Ende einer Regierungsjahres zwischen 88 und 96 n.Chr. zu datieren (am Original geprüft von R. Scholl und nach einem Photo), D. Hagedorn, Z.P.E. 159 (2007), S. 264.\";}','bernini'),(6535,'create','2014-04-08 16:13:24','2094','Papyrillio\\BeehiveBundle\\Entity\\Task',1,'a:2:{s:11:\"description\";s:36:\"Enter correction to DDbDP via editor\";s:7:\"cleared\";N;}','bernini'),(6536,'create','2014-04-08 16:13:24','2299','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";s:5:\"14-19\";s:11:\"description\";s:659:\"ὅπως - - - | [γ]ινώμε̣θα πρὸς τὰς τ̣[αφὰς] | - - - καὶ τὰ [νομι]|ζόμεν̣α̣ τ̣ο̣υ  ̣  ̣ ι̣α̣ ἐπ̣ι̣τ̣[ελῶ]|μ̣ε̣ν̣ [ὑπὲρ (?) σο]ῦ̣   ̣λ̣υ̣ε̣τ̣ε̣  ̣μ̣  ̣[  ̣  ̣] | [              ] Spuren (?) [    ] → ὅπως - - - | [γ]ινώμεθα πρὸς τὰς τ̣[αφὰς] | - - - καὶ τὰ [νομι]|ζόμεν̣α̣. Τούτου δὲ γεν[ο]|μέν[ου ἐσόμε]θ̣α τετευχό̣|[τες τῆς παρὰ] σ̣ο̣ῦ̣ [βοηθείας oder φιλανθρωπίας o. ä.] (nach dem Photo), Ch. Armoni, Tyche 21 (2006), S. 196.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(6537,'create','2014-04-08 16:33:59','2300','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";N;s:11:\"description\";s:114:\"Der Text ist nicht eines Bericht, sondern eine Eingangsformel einer Enteuxis, Ch. Armoni, Tyche 21 (2006), S. 196.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(6538,'create','2014-04-08 16:53:15','2095','Papyrillio\\BeehiveBundle\\Entity\\Task',1,'a:2:{s:11:\"description\";s:36:\"Enter correction to DDbDP via editor\";s:7:\"cleared\";N;}','bernini'),(6539,'create','2014-04-08 16:53:15','2301','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";s:4:\"2-15\";s:11:\"description\";s:503:\"ἐὰν οἱ παρὰ - - - τοῦ σιτο|λόγου μετρῶσιν̣ ἐ̣π̣ὶ τῶν | ἐ̣πακολουθούντων, [δὸς] κτλ. → ἐὰν οἱ παρὰ - - - τοῦ σιτο|λόγου μετρῶσιν̣ ἐ̣π̣ὶ τῶν | ἐ̣πακολουθούντων ἐκ κτλ. - - - π̣[υρο]ῦ̣ ἀρτάβας | [  ̣  ̣  ̣  ̣  ̣  ̣]τ̣α̣ τ̣[ρεῖ]ς̣ | [συγχρημάτισον bzw. συμπυροῦ κτλ.], Ch. Armoni, Tyche 21 (2006), S. 196.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(6540,'create','2014-04-08 17:18:54','2096','Papyrillio\\BeehiveBundle\\Entity\\Task',1,'a:2:{s:11:\"description\";s:36:\"Enter correction to DDbDP via editor\";s:7:\"cleared\";N;}','bernini'),(6541,'create','2014-04-08 17:18:54','2302','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";N;s:11:\"description\";s:216:\"πα̣[ρὰ   ] | τοῦ σιτολόγου → viell. πα̣[ρὰ Θεοδό]|του σιτολόγου (nach dem Photo): Theodotos ist dieselbe Person von P. Hib. 2. 245, Ch. Armoni, Tyche 21 (2006), S. 196-197.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(6542,'create','2014-04-08 17:22:48','2097','Papyrillio\\BeehiveBundle\\Entity\\Task',1,'a:2:{s:11:\"description\";s:36:\"Enter correction to DDbDP via editor\";s:7:\"cleared\";N;}','bernini'),(6543,'create','2014-04-08 17:22:48','2303','Papyrillio\\BeehiveBundle\\Entity\\Correction',1,'a:3:{s:8:\"position\";N;s:11:\"description\";s:109:\"Viell. sollte der Papyrus früher als 250-240 v.Chr. datiert werden, Ch. Armoni, Tyche 21 (2006), S. 196-197.\";s:6:\"status\";s:9:\"unchecked\";}','bernini'),(6544,'create','201