pyrillio\\BeehiveBundle\\Entity\\Correction',4,'a:1:{s:11:\"description\";s:169:\"Δ̣  ̣  ̣  ̣[  ̣  ̣  ̣]ου → Α̣  ̣  ̣  ̣[  ̣  ̣  ̣]ου: wahrscheinlich derselbe Ἀσκληπιάδης wie Z. 9, Ch. Armoni, Tyche 21 (2006), S. 195.\";}','bernini'),(6791,'update','2014-05-22 11:49:05','1981','Papyrillio\\BeehiveBundle\\Entity\\Correction',3,'a:1:{s:11:\"description\";s:104:\"Phoebammon könnte derselbe wie Photius, Bibl. cod. 279.536a sein, N. Gonis, Archiv 51 (2005), S. 87-88.\";}','bernini'),(6792,'update','2014-05-22 11:49:33','1996','Papyrillio\\BeehiveBundle\\Entity\\Correction',5,'a:1:{s:11:\"description\";s:268:\"Der vir clarissimus Flavius Ausonius ist wahrscheinlich derselbe wie S.B. 22. 15586, P. Vindob. Sijp. 9, Stud. Pal. 20. 111, P. Heid. 7. 408, und viell. der corrector Augustamnicae der liegt in den Briefen von Isidor von Pelusium, N. Gonis, Archiv 51 (2005), S. 88-90.\";}','bernini'),(6793,'update','2014-05-22 11:50:27','2267','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:143:\"Σωσικοσ]|μείῳ → Νεοκοσ]|μείῳ: er würde derselbe wie P. Merton 2. 76, Z. 5 sein, W. Clarysse, Tyche 22 (2007), S. 225.\";}','bernini'),(6794,'update','2014-05-22 11:50:56','2052','Papyrillio\\BeehiveBundle\\Entity\\Correction',3,'a:1:{s:11:\"description\";s:111:\"Zu datieren vor dem 530 n.Chr. bei Ioannes ist derselbe wie B.G.U. 2. 369, N. Gonis, Z.P.E. 159 (2007), S. 269.\";}','bernini'),(6795,'update','2014-05-22 11:51:29','2053','Papyrillio\\BeehiveBundle\\Entity\\Correction',6,'a:1:{s:11:\"description\";s:227:\"Die richtige Lesung ist Τ̣αύλου (l. Ταύρου), daher Flavius Septimius Taurus gemeint ist, wahrscheinlich derselbe wie P. Oxy. 7. 1033, Z. 3 (nach dem Photo; wie B.L. 13, S. ...), N. Gonis, Z.P.E. 159 (2007), S. 270.\";}','bernini'),(6796,'update','2014-05-22 11:52:08','1804','Papyrillio\\BeehiveBundle\\Entity\\Correction',4,'a:1:{s:11:\"description\";s:126:\"Philoxenos, Vater des Gerontios, ist viell. derselbe wie Stud.Pal 3.2 164, Z. 1, S. Kovarik, Archiv 53 (2007), S. 154 und 170.\";}','bernini'),(6797,'update','2014-05-22 11:52:36','1814','Papyrillio\\BeehiveBundle\\Entity\\Correction',3,'a:1:{s:11:\"description\";s:180:\"Νειλάμμων ὁ καὶ βόηθος ist viell. derselbe wie S.B. 1. 4483, Z. 4-5, P. Ross.-Georg. 3. 55, Z. 8, S.B. 1. 4488, 9, S. Kovarik, Archiv 53 (2007), S. 152 Anm. 2.\";}','bernini'),(6798,'update','2014-05-22 11:53:03','2290','Papyrillio\\BeehiveBundle\\Entity\\Correction',2,'a:1:{s:11:\"description\";s:215:\"Der Notar ist wahrscheinlich derselbe wie B.G.U. 1. 307 und B.G.U. 2. 368, S. Kovarik, Tyche 22 (2007), S. 117. [the identification of Kosmas 10.7 of BGU 368 and 10.8 of BGU 307 was suggested also by MPER XVI p. 43]\";}','bernini'),(6799,'update','2014-05-22 11:54:05','2057','Papyrillio\\BeehiveBundle\\Entity\\Correction',3,'a:1:{s:11:\"description\";s:97:\"Viell. Menas könnte derselbe wie S.B. 18. 13116, Z. 2 sein, N. Gonis, Z.P.E. 159 (2007), S. 270.\";}','bernini'),(6800,'update','2014-05-22 11:54:37','2059','Papyrillio\\BeehiveBundle\\Entity\\Correction',3,'a:1:{s:11:\"description\";s:95:\"Gerontios könnte viell. derselbe wie S.B. 24. 16233 sein, N. Gonis, Z.P.E. 159 (2007), S. 271.\";}','bernini'),(6801,'update','2014-05-22 11:55:10','1980','Papyrillio\\BeehiveBundle\\Entity\\Correction',4,'a:1:{s:11:\"description\";s:166:\"Der σχολαστικός Flavius Andronicus wie Stud.Pal. 20. 122 könnte derselbe von Photius, Bibl. cod. 279.536a sein, N. Gonis, Archiv 51 (2005), S. 87, Anm. 2.\";}','bernini'),(6802,'update','2014-05-22 11:55:37','1989','Papyrillio\\BeehiveBundle\\Entity\\Correction',5,'a:1:{s:11:\"description\";s:189:\"Der curialis Olympius ist derselbe wie M.P.E.R. 15. 63, Z. 33 (er könnte derselbe Olympius von C.P.R. 10. 114 , C.P.R. 19. 51 und P. L.Bat. 11. 22 sein), N. Gonis, Archiv 51 (2005), S. 92.\";}','bernini'),(6803,'update','2014-05-22 11:56:16','2302','Papyrillio\\BeehiveBundle\\Entity\\Correction',3,'a:1:{s:11:\"description\";s:209:\"πα̣[ρὰ   ] | τοῦ σιτολόγου → viell. πα̣[ρὰ